import { useParams } from 'react-router-dom';
import axios from 'axios';
import './Breed.css'

const Breed = () => {

    type BreedParams = {
        breed: string
    }

    const params = useParams<keyof BreedParams>() as BreedParams

    const [image, setImage] = useState<string>()
    const [breed, setBreed] = useState<string>()
    const [subBreed, setSubBreed] = useState<string>()


    useEffect(() => {
        console.log(params)
        setBreed(params.breed.split("-")[0])
        setSubBreed(params.breed.split("-")[1])

        // let breed = params.breed.split("-")[0]
