        // .then(res =>{
        //     setImage(res.data.message)
        //     console.log(breed)
        // })
        // .catch(err => {
        //     console.log(err)
        // })
    }, [])

    useEffect(() => {
        axios.get(`https://dog.ceo/api/breed/${breed}/${subBreed}/images/random`)
        .then(res =>{
            setImage(res.data.message)
            console.log(breed)
        })
        .catch(err => {
            console.log(err)
        })
    }, [breed])

    return (
        <div>
            {/* <h1>
                {breed} {subBreed}
            </h1> */}
            <img src={image}></img>
        </div>
    );
}

export default Breed;
